import './App.css';
import './output.css';
import HomePage from "./components/HomePage/Home";
import About from "./components/About";
import Skills from './components/Skills/Skills';
import Connect from './components/Connect/Connect';

function App() {
  return (
    <div className="App ">
      <HomePage/>
      <About/>
      <Skills/>
      <Connect/>
    </div>
  );
}

export default App;
